import React from 'react';
import Todo from './Todo';

const TodoList = ({ todo }) => {
  return (
    <div>
      {todo.map((todo, index) => (
        <Todo key={index} todo={todo} index={index} />
      ))}
    </div>
  );
};

export default TodoList;
